import React from 'react';
import "../Our_qualities/Ourqualities.scss";
import Qbuttons from './QualitiesButtons/Qbuttons';

export default function Ourqualities() {
  return (
    <div className='container-fluid qualities_container'>
        <div className="row">
            <div className="col-3"><Qbuttons text={"FAST TURNAROUND"}/></div>
            <div className="col-3"><Qbuttons text={"ADVANCED ANIMATIONS"}/></div>
            <div className="col-3"><Qbuttons text={"FREE SEO SETUP"}/></div>
            <div className="col-3"><Qbuttons text={"LIGHTNING-FAST WEBSITE"}/></div>
        </div>
        <div className="row">
            <div className="col-4"><Qbuttons/></div>
            <div className="col-4"><Qbuttons/></div>
            <div className="col-4"><Qbuttons/></div>
        </div>
    </div>
  )
}
